questionvariables.text:
/*Randomisation constants*/
const: rand([5,6,7,8]);

/*Question variables*/

cross_area: 1/2*(y+3)*x;
metal_eqtn: AB+BC = const;
roof: sqrt(x^2+(3-y)^2);
front: y;

eq0:subst(roof,AB,metal_eqtn);
eq1: subst(front,BC,eq0);
eq2: roof^2=(const-y)^2;
eq3: solve(eq2,x^2)[1];
eq4: solve(eq2,y)[1];

area_sub: expandwrt(ev(cross_area,eq4),x^2)
darea: diff(area_sub, x);
points: solve([eq4,darea=0],[x,y]);
point: sublist(points, lambda([x], is(rhs(x[1])>0)))[1];
max_area: subst(point,cross_area);


/*Answers*/
ta1: cross_area;
ta2: metal_eqtn;
ta3: eq3;
ta4: rhs(point[1]);
ta5: rhs(point[2]);
ta6: max_area;

/*Display*/
x_approx: decimalplaces(float(ta4),4);
y_approx: decimalplaces(float(ta5),4);
A_approx: decimalplaces(float(max_area),4);
